import { Stack } from '@mui/material';
import '../user.css';
import { UsernameField, PasswordField, SubmitButton } from '../user';
import { useState } from 'react';

export function Register() {
	const [showPassword, setShowPassword] = useState(false);

	return (
		<div className='center'>
			<Stack
				direction='column'
				spacing={2}
				component='form'
				p='24px'
				method='post'
				action='/users/login'
			>
				<UsernameField />
				<PasswordField showPassword='' label='Password' />
				<PasswordField label='Confirm Password' />
				<SubmitButton />
			</Stack>
		</div>
	);
}
